import React, { useEffect, useState } from "react";

const Home = () =>{

    const [fırsatListe,setFırsatListe] = useState([])

    const film_img="https://www.cheapshark.com/logo"

    useEffect(() =>{
        const api_link="https://www.cheapshark.com/api/1.0/stores"
        fetch(api_link)
        .then(fl=>fl.json())
        .then(fl=>{
            setFırsatListe(fl)
        })
    },[])

    return(
        <div>
            {
                fırsatListe.map(fl=>
                    <div>
                        <h1>{fl.storeName}</h1>
                        <img src={film_img + fl.logo} />
                    </div>
                    )
            }

        </div>
    )
}

export default Home;
